import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './Todo.scss';

class Todo extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { msg } = this.props;
    return <div className="todo">{msg}</div>;
  }
}

Todo.propTypes = {
  msg: PropTypes.string,
};

Todo.defaultProps = {
  msg: 2,
};

export default Todo;
